import React from 'react';
import MyInput from './MyInput'
import './Login.css'

function Login() {
    return (
        <div className="Login-card">
            <MyInput label={'Nome'} value={10}/>
            <MyInput label={'Senha'} value={10}/>
        </div>
    );
}

export default Login;
